ahQ(){return A.a([new A.dy("An Anonymous Girl","The newest suspense novel from the authors behind The Wife Between Us introduces us to Jessica Ferris. Jess just wants to make a little extra cash when she decides to participate in a study on ethics with the mysterious Dr. Lydia Shields. The premise seems simple: Answer a few questions, then collect. But soon the doctor\u2019s questions turn from simple survey queries to something much more sinister\u2014leaving Jess unsure of whom she can trust. An early contender for thriller of the year.",new A.eL("Greer Hendricks"),"assets/books/an_anonymous_girl_by_greer_hendricks.jpg"),new A.dy("The Water Cure","The Water Cure has drawn instant comparisons to The Handmaid\u2019s Tale, and not just because author Margaret Atwood called it \u201ca gripping, sinister fable.\u201d The book centers on Grace, Lia, and Sky, three sisters who live on an isolated island with their mother and their father, whom they call King. When their father disappears, their lives\u2014as well as everything they\u2019ve been told about the outside world\u2014are upended.",new A.eL("Sophie Mackintosh"),"assets/books/the_water_cure_by_sophie_mackintosh.jpg"),new A.dy("The Dreamers","Set in a Southern California college town, The Dreamers begins with the odd case of a student who walks into her dorm room, passes out, and doesn\u2019t wake up. Soon a second girl falls asleep, then a third, and on it goes. The victims are locked in a heightened dream state, having wild fantasies and hallucinations\u2014all while a group of students, teachers, and doctors struggle to wake them.",new A.eL("Karen Thompson"),"assets/books/the_dreamers_by_karen_thompson.jpg"),new A.dy("Maid","Growing up, Land had always planned on escaping her hometown and becoming a writer. But after an unexpected pregnancy, her dreams were put on hold. She became a housekeeper, went on food stamps, and at times lived in government housing to make ends meet. All the while she took online college classes and wrote stories about the people around her: working-class Americans. Land's memoir is this year\u2019s Educated; you\u2019ll love her fighting spirit and learn from her look at poverty in the United States..",new A.eL("Stepanie Land"),"assets/books/maid_by_stepanie_land.jpg"),new A.dy("The Suspect","If you obsessively followed the stories of Natalee Holloway, Madeleine McCann, and Jayme Closs, read The Suspect. From the author of the New York Times best-seller The Widow, Barton\u2019s latest novel centers on what happens when two girls vanish in Thailand. With the girls\u2019 families thrown into the international spotlight, journalists descend to crack the case. But as this thriller unfolds, it becomes clear the real danger is closer to home. The Suspect is an edge-of-your-seat suspense novel about a parent\u2019s worst nightmare.",new A.eL("Fiona Barton"),"assets/books/the_suspect_by_fiona_barton.jpg"),new A.dy("The Lost Girls of Paris","Jenoff, the author of New York Times best-seller The Orphan\u2019s Tale, is back with a novel about a group of female secret agents during World War II. Based on a series of real-life events, the book opens in Manhattan in 1946, when a woman discovers a suitcase that belonged to the leader of a network of spies based in London during the war. What follows is a portrait of sisterhood, courage, and drama. A must-read.",new A.eL("Pam Jenoff"),"assets/books/the_lost_girls_of_paris_by_pam_jenoff.jpg"),new A.dy("The Age of Light","Is \u201cwoman behaves dangerously, lives wildly\u201d a genre? If so, The Age of Light is its latest poster child. The novel is a work of historical fiction about Lee Miller, a real-life Vogue model who became one of the first female war correspondents. Scharer\u2019s plot takes off when Miller travels to Paris where she meets photographer Man Ray, who becomes her collaborator and lover. While most stories about Miller paint her as Ray\u2019s muse, this one portrays her as the independent and daring artist she truly was.",new A.eL("Whitney Scharer"),"assets/books/the_age_of_light_by_whitney_scharer.jpg"),new A.dy("The Last Romantics","The second novel from the writer behind New York Times best-seller The House Girl is a modern epic. When poet Fiona Skinner is asked about the inspiration behind her most famous work, she begins to trace the arc of her childhood. She recalls her father's unexpected death, her mother's descent into a paralyzing depression, and her siblings' determined survival. Her father's death shaped each of their lives and still haunts Fiona in her work. In the vein of Commonwealth, The Last Romantics is a sweeping look at what binds families together.",new A.eL("Tara Conklin"),"assets/books/the_last_romantics_by_tara_conklin.jpg"),new A.dy("The Night Tiger","Set in the 1930s in Malaysia, The Night Tiger opens when 11-year-old houseboy Ren discovers his master has just died. The master's final wish was for Ren to find the man\u2019s finger\u2014which he\u2019d lost years before in an accident\u2014so it can be buried with him. If the boy fails to find it, his master will be cursed and his soul will forever wander the earth. Across the district, Ji Lin, an apprentice dressmaker and dance hall girl by night, comes across an item that one of her dance partners has left behind, which sends her on her own adventure. Ren\u2019s and Ji Lin\u2019s paths soon crisscross as they embark on their journeys. It\u2019s a book for fans of Isabel Allende and for those who love a murder mystery with a beautiful backdrop.",new A.eL("Yangsze Choo"),"assets/books/the_night_tiger_by_yangsze_choo.jpg"),new A.dy("The Lost Night","If you couldn't get enough of TBS's Search Party, or more recently Netflix's Russian Doll, pick up a copy of The Lost Night. Much like these two shows, this book also centers on a young woman posing as an amateur detective to solve a murder. Back in 2009 the novel's protagonist, Lindsay, partied with her friends and the queen bee of their group, Edie. After a long night of binge drinking, Lindsay woke up to find Edie dead of an apparent suicide. Now, a decade later, Lindsay discovers new evidence that could prove that Edie was murdered\u2014and that Lindsay might have been involved. The rest of this haunting debut follows Lindsay as she tries to piece together what really happened on that awful, forgotten night.",new A.eL("Andrea Bartz"),"assets/books/the_lost_night_by_andrea_bartz.jpg"),new A.dy("You Know You Want This","Roupenian broke the Internet when The New Yorker published her viral short story \u201cCat Person\u201d in 2017. Quick refresher: It was about a college-age girl who sleeps with an older man because she feels like she \u201cowes\u201d it to him, not quite because she wants to. In her debut collection, Roupenian continues to explore the inner workings of sex, trauma, kinks, and manipulation.",new A.eL("Kristen Roupenian"),"assets/books/you_know_you_want_this_by_kristen_roupenian.jpg")],t.Su)},
